            <div id='text' className='font-satoshi-medium text-right font-[400] text-[20px] leading-[150%] text-[#4040F2]'>Self-custodial wallet, który pozwala Ci zarządzać środkami w sposób dyskretny i bezpieczny. Bez potrzeby znajomości kryptowalut. Bez pośredników. Bez ograniczeń.</div>
            </div>
        </div>
        <div id="request">123</div>
        </div>
      </section>
    );
  };

  export default Solution;
